const OverviewCard = ({ icon, socialIcon, title, viewsNum, viewsPercent }) => {
    return (
        <div className="overview-card">
            <div><p>{title}</p></div>
            <div>{socialIcon}</div>
            <div>{viewsNum}</div>
            <div><img src={icon} alt="icon" /> {viewsPercent}%</div>
        </div>
    )
}
export default OverviewCard
